CREATE SCHEMA IF NOT EXISTS retail;


CREATE TABLE IF NOT EXISTS retail.sales (
    "Date" VARCHAR(512),
    "City" VARCHAR(512),
    "Product" VARCHAR(512),
    "Category" VARCHAR(512),
    "Refine_Quantity" INT,
    "Price_per_unit" NUMERIC(10,2),
    "Revenue" NUMERIC(10,2),
    "Revenue_Flag" VARCHAR(512),
    "Returned_Flag" VARCHAR(512),
    "Footfall" INT,
    "Brand" VARCHAR(512)
);

